    return (
        <div className="navbar">

          <Link to="/">Home</Link>
          <Link to="/account">Account</Link>
          <Link to="/settings">Settings</Link>

          <Link to="/settings" onClick = { this.props.logOut } > Logout </Link>


        </div>
    )
  }
}

export default Navbar;
